function setType(iGuid, type) {

var dataString = 'iGuid=' + iGuid + "&type=" + type;
        console.log(dataString);
        $.ajax({
        type: "POST",
                url: "https://pogo.rocks/tools/poke_type_set.php",
                data: dataString,
                success: function (result) {
                    
                    document.getElementById(type+iGuid).style.display = 'block';
   
                    document.getElementById(type+iGuid).style.display = 'none';
        
              //  alert("Location set! It'll show up when you refresh the page.");
                          

                },
                error: function (err) {
                alert("fail " + err);
                }
        });
        }




